class Rect{constructor(x=0,y=0,width=0,height=0){this.x=x,this.y=y,this.width=width,this.height=height}collides(other=new Rect){function inRange(base,max,test){return base<=test&&test<=max}return(inRange(this.x,this.x+this.width,other.x)||inRange(this.x,this.x+this.width,other.x+other.width))&&(inRange(this.y,this.y+this.height,other.y)||inRange(this.y,this.y+this.height,other.y+other.height))}setX(x){this.x=x}setY(y){this.y=y}}